      SELECT DISTINCT col1 FROM tab1 (FORMAT parquet) WHERE - col0 * 87 - - 37 - + + col0 * - col1 - - 67 NOT BETWEEN ( 40 * - 83 ) AND ( col2 );
  - name: tab1

outputs:
